import React from 'react';
import { Container, Col, Row, Button,DropdownButton,Dropdown } from 'react-bootstrap';
class Header extends React.Component {
    constructor()
    {
        super();
        this.handle=this.handle.bind(this);
    }
    handle()
    {
        console.log('The link was clicked.');
    }
    render() { 
        return ( 
            <Container fluid="true">
            <Row>
            <Col xl={1} style={{backgroundColor: 'orange'}}>logo</Col>
            <Col xs xl={10} lg md sm ><marquee style={{backgroundColor:"yellow",height:"50px"}}>PVG's College of Science</marquee></Col>
            <Col xl={1}>
            <DropdownButton variant="danger"  alignRight title="Admin" size="lg" >
              <Dropdown.Item as="button"  onClick={this.handle}>Change Password</Dropdown.Item>
              <Dropdown.Item as="button" >Logout</Dropdown.Item>
            </DropdownButton>
            </Col>
            </Row>
            </Container> 
        );
    }
}
 
export default Header;
